ERT:"Pancerna wkładka zapewnia dodatkową warstwę ochronną przeciw obrażeniom balistycznym klatki piersiowej, dzięki czemu posiadacz ma czas, żeby zareagować w sytuacji zagrożenia.",BFH_ID_P_IDESC_BALLISTIC_SHIELD:"Tarcza balistyczna blokuje kule i chroni przed wybuchami. Zostaje zniszczona po przyjęciu określonej liczby obrażeń. Można nią atakować wręcz.",BFH_ID_P_IDESC_BEACON:"Telefon satelitarny zapewnia nowy punkt odrodzeń tobie i członkom drużyny.",BFH_ID_P_IDESC_C4:"Plastyczny materiał wybuchowy, który można umieścić na większości powierzchni. Dzięki zdalnemu detonatorowi nadaje się do wykorzystania w zasadzkach.",BFH_ID_P_IDESC_DECOY:"Hałasująca przynęta, która wysyła wrogom mylące sygnały pozycji gracza na radarze, a także wydaje fałszywe odgłosy strzałów.",BFH_ID_P_IDESC_DEFIB:"Defibrylator pozwala reanimować nieprzytomnych sojuszników. Po dłuższym przygotowaniu przywraca członków drużyny do życia z większym zapasem zdrowia. W pełni naładowanym defibrylatorem można też wyeliminować wroga.",BFH_ID_P_IDESC_DEPLOYABLE_CAMERA:"Kamera wykrywająca wrogów na obszarze szerokiego stożka przed sobą i powiadamiająca o ich obecności. Lepiej nie lekceważyć mediów!",BFH_ID_P_IDESC_DINO_MASK:"W tej gumowej masce dinozaura będziesz siać postrach wśród przestępców. Gratulacje – należysz do elity!",BFH_ID_P_IDESC_FLASHBANG:"Granat błyskowo-hukowy M84. Wydaje przeszywający dźwięk, któremu towarzyszy oślepiający błysk. Może dezorientować i rozpraszać wrogów.",BFH_ID_P_IDESC_GAS_GRENADE:"Granat z zapalnikiem czasowym emitujący chmurę gazu łzawiącego. Cele objęte jego działaniem cierpią na zaburzenia wzroku utrudniające celowanie oraz otrzymują większe obrażenia.",BFH_ID_P_IDESC_GAS_MASK:"Maska przeciwgazowa chroni przed działaniem granatów gazowych, a także neguje efekty niektórych niebezpiecznych czynników środowiskowych.",BFH_ID_P_IDESC_GRAPPLEHOOK:"Po przymocowaniu wystrzelonego haka do płaskiej krawędzi pojawi się lina, po której można się wspiąć. Liny da się zniszczyć poprzez odstrzelenie lub przecięcie.",BFH_ID_P_IDESC_INCENDIARY_DEVICE:"Ręczny granat zapalający, który w momencie eksplozji tworzy ognistą przeszkodę. Można go używać do blokowania przejść i płoszenia wrogów za osłoną.",BFH_ID_P_IDESC_LASER_TRIPMINE:"Mina, która eksploduje, gdy ofiara wejdzie w zasięg linii lasera. Minę tego typu można umieścić na dowolnej powierzchni w zasięgu ręki. Jeśli jednak agent zdoła dostrzec tę pułapkę, może ją rozbroić.",BFH_ID_P_IDESC_M18:"Granat z zapalnikiem czasowym rozpylający chmurę dymu, która uniemożliwia dostrzeganie celów.",BFH_ID_P_IDESC_M67:"Granat odłamkowy o dużej sile rażenia i średnim promieniu wybuchu. Zadaje znaczne obrażenia piechocie i pojazdom.",BFH_ID_P_IDESC_M79:"Nic nie wskazuje na to, żeby ta wyrzutnia granatów pochodziła z legalnego źródła. Broń tego typu jest ładowana odtylcowo. Wystrzeliwuje silnie eksplodujące granaty 40 mm, szczególnie efektywne w walce z lekkimi pojazdami i agentami.",BFH_ID_P_IDESC_MEDKIT:"Przenośna apteczka pierwszej pomocy. Żołnierze, którzy znajdą się w jej pobliżu, będą powoli odzyskiwać zdrowie, nawet podczas walki. Sojusznicy mogą się leczyć poprzez interakcję z posiadaczem tego przedmiotu.",BFH_ID_P_IDESC_MOLOTOV:"Koktajle Mołotowa to szklane butelki z łatwopalną substancją, np. benzyną. W warunkach bojowych używa się ich najczęściej, aby odciąć wrogom dostęp do punktów strategicznych.",BFH_ID_P_IDESC_NOGADGET1:Tn,BFH_ID_P_IDESC_NOGADGET2:Tn,BFH_ID_P_IDESC_REPAIR:"Palnik acetylenowo-tlenowy służący do naprawy pojazdów sojuszniczych, sabotowania pojazdów wroga oraz eliminacji agentów.",BFH_ID_P_IDESC_REVIVE:"Zastrzyk adrenaliny może natychmiast przywrócić do życia nieprzytomnego sojusznika. W przypadku dłuższego przygotowania członek zespołu odzyska większy zapas zdrowia. Gotowym zastrzykiem można też wyeliminować wroga.",BFH_ID_P_IDESC_SABOTAGE:"Bomba do minowania pojazdów, punktów strategicznych i miejsc interakcji. Ładunek eksploduje, gdy obiekt zostanie użyty przez wroga. Uwaga na migające światło. Bombę można rozbroić palnikiem lub aktywować strzałem bądź eksplozją.",BFH_ID_P_IDESC_STEALTHTRAINING:"Agent, który przeszedł trening maskowania, umie poruszać się bezszelestnie. Odgłosy jego kroków są cichsze. Ponadto ciszej wykonuje takie czynności, jak otwieranie drzwi.",BFH_ID_P_IDESC_STUNTDRIVER:"Modyfikacja kierowcy wyczynowego wyposaża pojazd naziemny w podtlenek azotu, który pozwala uzyskać natychmiastowe przyśpieszenie. Ponadto kierowcy wyczynowi odnoszą mniejsze obrażenia w wyniku kolizji.",BFH_ID_P_IDESC_SURVIVALIST:"Uzyskasz możliwość wskrzeszenia się po śmierci pod kołami pojazdu lub w wyniku wybuchu. Zdolność ta nie pozwoli się zregenerować po śmierci w wyniku ostrzału, poparzeń, porażenia, ataku wręcz bądź gazem ani upadku z dużej wysokości.",BFH_ID_P_IDESC_TASER_GUN:"T62 CEW pozwala wyeliminować cel z małej odległości, nie zabijając go. Możesz przesłuchać porażonego wroga, aby dowiedzieć się, gdzie są jego sojusznicy (tylko tryb online).",BFH_ID_P_IDESC_TRACKING_DART:"Traf wroga lub pojazd strzałką namierzającą, aby oznaczyć te cele w świecie gry i na minimapie, a także umożliwić ich namierzenie posiadaczom wyrzutni rakiet.",BFH_ID_P_IDESC_WOLF_MASK:"Ta gumowa maska wilka idealnie nadaje się na napady w wielkim stylu. Gratulacje – należysz do elity!",BFH_ID_P_IDESC_ZIPLINE:"Z tej wyrzutni można wystrzelić linę, która pozwoli szybko przemieścić się do niższego punktu. Liny wrogów można niszczyć, obcinając je lub usuwając mocowania.",BFH_ID_P_INAME_40MM:"M320 Odłamki",BFH_ID_P_INAME_ACB90:"Acb-90",BFH_ID_P_INAME_AMMO:"Amunicja",BFH_ID_P_INAME_ARMORINSERT:"Pancerna Wkładka",BFH_ID_P_INAME_BALLISTIC_SHIELD:"Tarcza Balistyczna",BFH_ID_P_INAME_BAT:"Kij Baseballowy",BFH_ID_P_INAME_BAYONETT:"Nóż",BFH_ID_P_INAME_BAYONETT_GOLD:"Nóż (Złoty)",BFH_ID_P_INAME_BEACON:"Telefon Satelitarny",BFH_ID_P_INAME_BLACKJACK:"Blackjack",BFH_ID_P_INAME_BPKNIFE2:"Skautowski",BFH_ID_P_INAME_BPKNIFE2_GOLD:"Skautowski (Złoty)",BFH_ID_P_INAME_BPKNIFE3:"Bojowy",BFH_ID_P